        mHdltvinHandle << " , " <<  " \"s_axi_CRTLS_ARADDR\" :  \"" << s_axi_CRTLS_ARADDR.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"s_axi_CRTLS_RVALID\" :  \"" << s_axi_CRTLS_RVALID.read() << "\" ";
